import { StyleSheet, Image, ImageBackground, View, } from "react-native";
import { LinearGradient } from 'expo-linear-gradient';
import { Ionicons } from '@expo/vector-icons';
import { NativeBaseProvider, Box, Container, Heading, Divider, IconButton, Flex, HStack, Text, Icon, VStack, Center, StatusBar, Button } from 'native-base';
import { MaterialIcons } from '@expo/vector-icons';

export default function TabOneScreen() {
  return (
    <NativeBaseProvider>
      <AppBar />
      <Divider />
      <ImageBackground imageStyle=
        {{ opacity: 0.5 }} style={styles.image} source={require('../assets/images/splashbg.png')} resizeMode="cover" />
    </NativeBaseProvider>
  );
}

function AppBar() {
  return (
    <>


      <Box safeAreaTop backgroundColor="#f2e6d9" />

      <HStack bg='#e6e600' px="1" justifyContent='space-between' alignItems='center'>
        <HStack space="4" alignItems='center'>
          <Image style={styles.coin} source={require('../assets/images/icon2.gif')} />
        </HStack>
        <HStack space="2">
          <Text style={styles.icon}>
            <Ionicons name="ios-person-circle-outline" size={20} /> David Williams
          </Text>
        </HStack>
      </HStack>

    </>
  )
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  icon: {
    color: 'black',
    fontSize: 16,
    fontWeight: 'bold',


  },
  balance: {
    fontSize: 25,
    width: '100%',
  },
  coin: {
    width: 50,
  },
  coingif: {
    size: '100%',
  },
  coingif: {
    width: 10,
  },
  image: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    width: '100%',
  },
  title: {
    width: 400,
    resizeMode: 'cover',
    marginTop: -100,
    marginBottom: -100,
    margin: -100,
  },
  header: {
    marginTop: '15%',
    marginLeft: '18%',
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    backgroundColor: '#fff',
  },
});
